import{_ as i,c as t,ah as o,o as s}from"./chunks/framework.BWXOFiC5.js";const h=JSON.parse('{"title":"Common Issues","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/Troubleshooting/common-issues.md","filePath":"Documentation/Troubleshooting/common-issues.md"}'),n={name:"Documentation/Troubleshooting/common-issues.md"};function l(r,e,a,u,c,p){return s(),t("div",null,e[0]||(e[0]=[o('<h1 id="common-issues" tabindex="-1">Common Issues <a class="header-anchor" href="#common-issues" aria-label="Permalink to &quot;Common Issues&quot;">​</a></h1><p>This guide addresses the most frequently encountered issues in ImmyBot and provides step-by-step solutions to resolve them quickly.</p><h2 id="agent-connection-issues" tabindex="-1">Agent Connection Issues <a class="header-anchor" href="#agent-connection-issues" aria-label="Permalink to &quot;Agent Connection Issues&quot;">​</a></h2><h3 id="agent-shows-as-offline" tabindex="-1">Agent Shows as Offline <a class="header-anchor" href="#agent-shows-as-offline" aria-label="Permalink to &quot;Agent Shows as Offline&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Computer appears offline in ImmyBot</li><li>Cannot run maintenance or tasks</li><li>Remote control options unavailable</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Verify Network Connectivity</strong></p><ul><li>Ensure the computer has internet access</li><li>Check that it can reach the ImmyBot server <ul><li>This information is unique per ImmyBot instnace and can be found in <strong>Show More</strong> &gt; <strong>SMTP</strong> &gt; <strong>&quot;Fetch IP Addresses and Hostnames&quot;</strong></li></ul></li><li>Verify firewall rules allow the connection</li></ul></li><li><p><strong>Check Agent Service</strong></p><ul><li>On the computer, open Services (services.msc)</li><li>Locate the &quot;ImmyBot Agent&quot; service</li><li>Verify it&#39;s set to Automatic and is Running</li><li>If not running, start the service</li></ul></li><li><p><strong>Reinstall Agent</strong></p><ul><li>Download the agent installer from ImmyBot</li><li>Uninstall the existing agent</li><li>Restart the computer</li><li>Install the new agent</li></ul></li><li><p><strong>Check for Security Software Interference</strong></p><ul><li>Temporarily disable security software</li><li>See if the agent connects</li><li>If it does, configure exclusions (see <a href="/Documentation/Troubleshooting/security-software.html">Security Software Configuration</a>)</li></ul></li></ol><h3 id="agent-identification-failures" tabindex="-1">Agent Identification Failures <a class="header-anchor" href="#agent-identification-failures" aria-label="Permalink to &quot;Agent Identification Failures&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Agent connects but shows as &quot;Unidentified&quot;</li><li>Computer appears in New Computers repeatedly</li><li>Multiple entries for the same computer</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Computer Name</strong></p><ul><li>Verify the computer name is unique</li><li>Ensure it doesn&#39;t contain special characters</li></ul></li><li><p><strong>Review Identification Methods</strong></p><ul><li>Navigate to <strong>Show more</strong> &gt; <strong>Preferences</strong></li><li>In the Preferences page, find the Computer-related settings</li><li>Review the agent identification methods</li><li>Ensure appropriate methods are enabled <ul><li><p><strong>Auto resolve new computers with recent OS install dates</strong> Enabling this feature will treat all computers with recently installed OS (less than 24 hours old) as repurposed / wiped, (e.g., A computer already known to immy.bot is wiped clean and setup for a new person. The old reference to this computer will automatically be deleted).</p></li><li><p><strong>Enable historical computer inventory tracking</strong> Enable this to keep all computer inventory script results instead of only the latest results.</p></li><li><p><strong>Enable Non-Essential Device Inventorying</strong> Enabling this feature will cause immy.bot to automatically schedule all device inventory jobs when inventory details become outdated. (Recommended) Disabling it will limit immy.bot to scheduling only the inventory tasks required for it to function properly.</p></li><li><p><strong>Onboarding</strong> Enabling this feature will allow tenants to choose whether to automatically run maintenance against newly synced computers.</p></li><li><p><strong>Stale Computer Age</strong> This defines the number of days since an offline computer&#39;s last agent connection, after which the computer is considered &quot;stale.&quot; Stale computers are displayed on the tab of the computers list page.</p></li></ul></li></ul></li><li><p><strong>Check Hardware Changes</strong></p><ul><li>Significant hardware changes can affect identification</li><li>Review the computer&#39;s hardware profile</li><li>Update identification if needed</li></ul></li><li><p><strong>Manual Identification</strong></p><ul><li>Locate the computer in New Computers</li><li>Select the computer and use the appropriate action from the action menu</li><li>Choose the correct existing computer to associate with this agent</li></ul></li></ol><h2 id="maintenance-session-issues" tabindex="-1">Maintenance Session Issues <a class="header-anchor" href="#maintenance-session-issues" aria-label="Permalink to &quot;Maintenance Session Issues&quot;">​</a></h2><h3 id="maintenance-session-fails-to-start" tabindex="-1">Maintenance Session Fails to Start <a class="header-anchor" href="#maintenance-session-fails-to-start" aria-label="Permalink to &quot;Maintenance Session Fails to Start&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Maintenance session shows as &quot;Pending&quot; indefinitely</li><li>Session never progresses to &quot;Running&quot;</li><li>No actions are executed</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Agent Status</strong></p><ul><li>Verify the agent is online</li><li>Restart the agent service if needed</li></ul></li><li><p><strong>Check Endpoint Resource Utilization</strong></p><ul><li>High resource utilization can delay session starts</li><li>Check active sessions count</li><li>Consider rescheduling during off-peak hours</li></ul></li><li><p><strong>Review Session Logs</strong></p><ul><li>Navigate to the session details</li><li>Check for any error messages</li><li>Look for connection timeout errors</li></ul></li><li><p><strong>Restart ImmyBot Services</strong></p><ul><li>If you have server access, restart ImmyBot services</li><li>Check if sessions start properly after restart</li></ul></li></ol><h3 id="software-installation-failures" tabindex="-1">Software Installation Failures <a class="header-anchor" href="#software-installation-failures" aria-label="Permalink to &quot;Software Installation Failures&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Maintenance action shows as &quot;Failed&quot;</li><li>Software not installed</li><li>Error in installation logs</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Installation Source</strong></p><ul><li>Verify the installation file is accessible</li><li>Check file permissions</li><li>Ensure the URL is valid for downloaded installers</li></ul></li><li><p><strong>Review Installation Script</strong></p><ul><li>Check the software&#39;s installation script</li><li>Look for errors or outdated commands</li><li>Test the script manually if possible</li></ul></li><li><p><strong>Check Disk Space</strong></p><ul><li>Verify sufficient disk space is available</li><li>Clean up temporary files if needed</li></ul></li><li><p><strong>Check Prerequisites</strong></p><ul><li>Ensure all prerequisites are installed</li><li>Verify correct order of installations</li><li>Check for version conflicts</li></ul></li><li><p><strong>Review Logs</strong></p><ul><li>Check detailed logs for the specific error</li><li>Look for exit codes or error messages</li><li>Use these to refine your troubleshooting</li></ul></li></ol><h2 id="deployment-issues" tabindex="-1">Deployment Issues <a class="header-anchor" href="#deployment-issues" aria-label="Permalink to &quot;Deployment Issues&quot;">​</a></h2><h3 id="deployment-not-applying" tabindex="-1">Deployment Not Applying <a class="header-anchor" href="#deployment-not-applying" aria-label="Permalink to &quot;Deployment Not Applying&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Deployment shows as active but doesn&#39;t apply</li><li>No maintenance actions for the deployment</li><li>Software or configuration not applied</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Targeting</strong></p><ul><li>Verify the deployment targets include the computer</li><li>Check for exclusions that might apply</li><li>Test with a direct computer target</li></ul></li><li><p><strong>Review Deployment Settings</strong></p><ul><li>Check that the deployment is enabled</li><li>Verify the deployment mode is correct</li><li>Ensure version settings are appropriate</li></ul></li><li><p><strong>Check Dependencies</strong></p><ul><li>Verify any dependent software or configurations</li><li>Ensure prerequisites are properly deployed</li></ul></li><li><p><strong>Force Maintenance</strong></p><ul><li>Run a manual maintenance session</li><li>Select the specific deployment to apply</li><li>Monitor the session for issues</li></ul></li></ol><h3 id="deployment-conflicts" tabindex="-1">Deployment Conflicts <a class="header-anchor" href="#deployment-conflicts" aria-label="Permalink to &quot;Deployment Conflicts&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Multiple deployments trying to manage the same software</li><li>Inconsistent software versions</li><li>Deployments overriding each other</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Identify Conflicting Deployments</strong></p><ul><li>Search for deployments targeting the same software <ul><li>ImmyBot will only run 1 Deployment for the same software or task. If you need to run the same software or task multiple times you must create a copy of that task and deploy that. <ul><li>Example: You need to deploy several security certificiates. You need to make a copy of the global task &quot;Import Certificate&quot; for each certificate and deploy those once, instead of deploying the global task 4 times in the same scope.</li><li>Example: You need to deploy several printers through Immy. You need to make a copy of the global task &quot;Deploy Printer Template Task&quot;, rename it ideally to the printer name, and deploy that copied task. You would need to do this for each printer you have.</li></ul></li></ul></li><li>Check for version conflicts</li><li>Look for different deployment modes</li></ul></li><li><p><strong>Resolve Conflicts</strong></p><ul><li>Disable or delete redundant deployments</li><li>Consolidate deployments where possible</li><li>Ensure consistent versioning</li></ul></li><li><p><strong>Use Deployment Ordering</strong></p><ul><li>Deployment ordering can be found in <strong>Library</strong> &gt; <strong>Deployment Ordering</strong></li><li>Configure deployment ordering settings</li><li>Ensure higher-priority deployments take precedence</li><li>Test to verify correct behavior</li></ul></li></ol><h2 id="integration-issues" tabindex="-1">Integration Issues <a class="header-anchor" href="#integration-issues" aria-label="Permalink to &quot;Integration Issues&quot;">​</a></h2><h3 id="rmm-integration-not-importing-computers" tabindex="-1">RMM Integration Not Importing Computers <a class="header-anchor" href="#rmm-integration-not-importing-computers" aria-label="Permalink to &quot;RMM Integration Not Importing Computers&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Computers not appearing in ImmyBot</li><li>Customer mapping issues</li><li>Synchronization errors</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check API Credentials</strong></p><ul><li>Verify API key or credentials are correct</li><li>Ensure the API user has sufficient permissions</li><li>Test API connection manually if possible</li></ul></li><li><p><strong>Review Integration Settings</strong></p><ul><li>Check synchronization settings</li><li>Verify customer mapping configuration</li><li>Ensure correct filters are applied</li></ul></li><li><p><strong>Check Logs</strong></p><ul><li>Review integration logs for errors</li><li>Look for API rate limiting or timeout issues</li><li>Check for data format problems</li></ul></li><li><p><strong>Manual Sync</strong></p><ul><li>Trigger a manual synchronization</li><li>Monitor the process for errors</li><li>Check results after completion</li></ul></li></ol><h3 id="psa-integration-ticket-issues" tabindex="-1">PSA Integration Ticket Issues <a class="header-anchor" href="#psa-integration-ticket-issues" aria-label="Permalink to &quot;PSA Integration Ticket Issues&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Integration is unhealthy</li><li>Missing or out of date agreement information</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check API Connection</strong></p><ul><li>Verify API credentials are correct</li><li>Test the connection to the PSA</li><li>Check for API errors</li></ul></li><li><p><strong>Check User Permissions</strong></p><ul><li>Ensure that the permissions for the API Security group is correct per the documentation of the PSA you&#39;re using</li></ul></li></ol><h2 id="performance-issues" tabindex="-1">Performance Issues <a class="header-anchor" href="#performance-issues" aria-label="Permalink to &quot;Performance Issues&quot;">​</a></h2><h3 id="slow-maintenance-sessions" tabindex="-1">Slow Maintenance Sessions <a class="header-anchor" href="#slow-maintenance-sessions" aria-label="Permalink to &quot;Slow Maintenance Sessions&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>Maintenance sessions take unusually long</li><li>Actions timeout frequently</li><li>System performance degradation during maintenance</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Network Performance</strong></p><ul><li>Verify network bandwidth and latency</li><li>Test connection speed to the ImmyBot server</li><li>Check for network congestion</li></ul></li><li><p><strong>Review Resource Usage</strong></p><ul><li>Check CPU and memory usage during maintenance</li><li>Look for resource-intensive scripts</li><li>Monitor disk I/O performance</li></ul></li><li><p><strong>Optimize Maintenance Windows</strong></p><ul><li>Distribute maintenance across different time windows</li><li>Avoid peak usage times</li><li>Limit concurrent sessions</li></ul></li><li><p><strong>Review Script Efficiency</strong></p><ul><li>Identify slow-running scripts</li><li>Optimize script performance</li><li>Break large scripts into smaller components</li></ul></li></ol><h3 id="high-resource-usage" tabindex="-1">High Resource Usage <a class="header-anchor" href="#high-resource-usage" aria-label="Permalink to &quot;High Resource Usage&quot;">​</a></h3><p><strong>Symptoms:</strong></p><ul><li>ImmyBot agent using excessive resources</li><li>Server performance issues</li><li>Slow overall system performance</li></ul><p><strong>Troubleshooting Steps:</strong></p><ol><li><p><strong>Check Agent Resource Usage</strong></p><ul><li>Monitor agent CPU and memory usage</li><li>Look for spikes during specific operations</li><li>Check for memory leaks</li></ul></li><li><p><strong>Review Logging Level</strong></p><ul><li>Check logging verbosity settings</li><li>Reduce logging level if too verbose</li><li>Monitor impact on performance</li></ul></li><li><p><strong>Update Agent</strong></p><ul><li>Ensure you&#39;re using the latest agent version</li><li>Apply any available performance updates</li><li>Test performance after update</li></ul></li><li><p><strong>Optimize Server Resources</strong></p><ul><li>If hosting ImmyBot, check server resources</li><li>Allocate appropriate resources based on environment size</li><li>Consider scaling options for larger environments</li></ul></li></ol><h2 id="mdmdiagnostics-logs" tabindex="-1">MDMDiagnostics Logs <a class="header-anchor" href="#mdmdiagnostics-logs" aria-label="Permalink to &quot;MDMDiagnostics Logs&quot;">​</a></h2><p>For issues with device enrollment, MDMDiagnostics logs can help identify the root cause.</p><p><strong>Steps to Collect MDM Diagnostics:</strong></p><ol><li>From an elevated CMD Prompt, run:</li></ol><div class="language-bat vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bat</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">MDMdiagnosticstool.exe -area </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;DeviceProvisioning;DeviceEnrollment&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> -cab </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;C:\\Temp\\MDMDiag_Log.cab&quot;</span></span></code></pre></div><ol start="2"><li>The cab file may be too large to email, so you can create a cloud share and send the link to <code>support@immy.bot</code>.</li></ol><h2 id="next-steps" tabindex="-1">Next Steps <a class="header-anchor" href="#next-steps" aria-label="Permalink to &quot;Next Steps&quot;">​</a></h2><p>If you&#39;re still experiencing issues after following these troubleshooting steps:</p><ul><li><a href="https://www.immy.bot/support/" target="_blank" rel="noreferrer">Contact Support</a> for additional assistance</li><li>Check the <a href="https://community.immy.bot" target="_blank" rel="noreferrer">Community Forums</a> for similar issues</li><li>Review the <a href="/Documentation/Troubleshooting/troubleshooting.html">Agent Troubleshooting</a> guide for more detailed agent troubleshooting</li><li>See <a href="/Documentation/Troubleshooting/security-software.html">Security Software Configuration</a> for security software-specific issues</li></ul>',66)]))}const m=i(n,[["render",l]]);export{h as __pageData,m as default};
